import {makeAutoObservable} from "mobx";

class UserStore {
    constructor(){
        this._isAuth = false;
        this._isUser = false;
        this._isDoc = true;
        makeAutoObservable(this);
    }
    get isAuth(){
        return this._isAuth;
    }
    get isUser(){
        return this._isAuth;
    }

    get isDoc() {
        return this._isDoc;
    }

}

export default UserStore;
